import React from "react";
import {
    Row,
    Col,
    CardGroup,
    CardBody,
    CardTitle,
    Card,
    Table,
    FormGroup,
    Label,
    Input,
    CardColumns,
    CardDeck
} from "reactstrap";

const days = 7;

const createCard = (workout) => {
    if (workout == null) return (<Card></Card>);
    else return (
        <Card className={'mb-4'}>
            <CardTitle>{workout.name}</CardTitle>
            <CardBody>
                <Table>
                    <thead>
                    <tr>
                        <th>Exercise</th>
                        <th>Reps</th>
                        <th>Sets</th>
                        <th>Achieved</th>
                    </tr>
                    </thead>
                    <tbody>
                    {workout.exercises.map(e =>
                        <tr style={{height: 'auto'}}>
                            <td>{e.name}</td>
                            <td>{e.reps}</td>
                            <td>{e.sets}</td>
                            <td>
                                <Input type="checkbox"/>
                            </td>
                        </tr>)}
                    </tbody>
                </Table>
            </CardBody>
        </Card>
    )

}

const windowInnerWidth = window.innerWidth;
console.log(windowInnerWidth)

const WorkoutWeekTable = ({workouts}) => {
    return (
        <div>
            {workouts.map(workout => {
                if (workout.date) createCard(null);
                else createCard(workout)
            })}
        </div>
    )
};

export default WorkoutWeekTable;
